Insert into PROJECT.HOUSE (HOUSECODE,MEMBERCODE,HOUSENAME,EXPLAIN,BATH,ETC,CHECKINTIME,CHECKOUTTIME,NECESSARY,WIFI,WASHER,HOTWATER,AIRCON,TV,MART,PARKING,KITCHEN,SAFETY,ADDRESS,SIDO,SIGUNGU,ROADNAME,BNAME,JIBUNADDRESS,LATLNG,DETAILADDRESS,LOCAL,APPROVALSTATUS,BANK,ACCOUNT,PEOPLE,BED,PRICE,HOUSEREGDATE) values (54,43,'미르 게스트하우스','비즈니스 및 레저 여행 모두를 충족시킬 수 있는 본 숙소(미르 게스트하우스)는 도시에서 가장 유명한 지역 중 하나인 제주 시내에 있습니다. 이 곳에서 생동감 넘치는 도시의 많은 것을 최대로 즐길 수 있습니다. 본 숙소는 도시의 필수 관광 명소에 쉽게 접근할 수 있는 편리한 위치를 자랑합니다.
