Insert into PROJECT.HOUSE (HOUSECODE,MEMBERCODE,HOUSENAME,EXPLAIN,BATH,ETC,CHECKINTIME,CHECKOUTTIME,NECESSARY,WIFI,WASHER,HOTWATER,AIRCON,TV,MART,PARKING,KITCHEN,SAFETY,ADDRESS,SIDO,SIGUNGU,ROADNAME,BNAME,JIBUNADDRESS,LATLNG,DETAILADDRESS,LOCAL,APPROVALSTATUS,BANK,ACCOUNT,PEOPLE,BED,PRICE,HOUSEREGDATE) values (154,43,'스테이라움','신축건물이예요. 커플룸 과 트윈룸이 있어요. 깔끔한객실에서 소중한분 과 귀중한분이  예쁜내수면바다를 객실에서 감상하시고 황홀한 일출도 보시면서 예쁜추억도 만들어가시고 힐링도 하시면서 쉬실수있는 예쁜감성 숙소예요.',1,'아메리카노 커피 무료 써비스,새콤달콤 제주감귤무제한무료시식(소진시까지)','17:00','11:00','on','on','on','on','on','on',null,'on','on','on','제주특별자치도 서귀포시 성산읍 오조로 120',null,null,null,null,null,'33.46437,126.9143','오조리 570-4','seoguipoEast','승인완료','카카오뱅크',5021820418357,2,2,100000,to_date('19/12/31','RR/MM/DD'));
Insert into PROJECT.HOUSE (HOUSECODE,MEMBERCODE,HOUSENAME,EXPLAIN,BATH,ETC,CHECKINTIME,CHECKOUTTIME,NECESSARY,WIFI,WASHER,HOTWATER,AIRCON,TV,MART,PARKING,KITCHEN,SAFETY,ADDRESS,SIDO,SIGUNGU,ROADNAME,BNAME,JIBUNADDRESS,LATLNG,DETAILADDRESS,LOCAL,APPROVALSTATUS,BANK,ACCOUNT,PEOPLE,BED,PRICE,HOUSEREGDATE) values (159,62,'공유게스트하우스','제주도 조용하고 작은 마을 신도리에 신규 오픈한 게스트하우스입니다. 2인전용 객실 4개(더블룸 3개 / 트윈룸 1개) 를 운영중이며 전객실 전용욕실과 TV, 에어컨, 냉장고, 침구를 제공해 드리고 있으며, 객실과 공용공간에서 무료와이파이 사용 가능합니다. 욕실엔 개인 어메니티를 제공하고 있으며, 아침엔 조식을 제공해 드리고 있습니다. ',1,'2인 전용 게스트하우스입니다.','16:00','11:00','on','on','on','on','on','on','on','on','on','on','제주특별자치도 서귀포시 대정읍 도원로 20',null,null,null,null,null,'33.27659,126.1724','신도리 3092-1','seoguipoWest','승인완료','카카오뱅크',5021820418357,2,1,100000,to_date('19/12/31','RR/MM/DD'));
Insert into PROJECT.HOUSE (HOUSECODE,MEMBERCODE,HOUSENAME,EXPLAIN,BATH,ETC,CHECKINTIME,CHECKOUTTIME,NECESSARY,WIFI,WASHER,HOTWATER,AIRCON,TV,MART,PARKING,KITCHEN,SAFETY,ADDRESS,SIDO,SIGUNGU,ROADNAME,BNAME,JIBUNADDRESS,LATLNG,DETAILADDRESS,LOCAL,APPROVALSTATUS,BANK,ACCOUNT,PEOPLE,BED,PRICE,HOUSEREGDATE) values (218,21,'메종드오조락','메종 드 오조락 게스트하우스는 제주국제공항에서 차로 약 1시간 20분이 소요됩니다. 주변 관광명소로는 차로 약 10분 거리에 우도로 가는 배가 있는 성산포항과 세계자연유산에 지정된 성산일출봉이 자리하고 있습니다. 또한, 약 15분 거리에 초대형 메인 수조 등 그 규모를 자랑하는 아쿠아플라넷제주와 연풍연가 촬영지로도 유명한 섭지코지가 있습니다.',1,'게스트하우스의 고객님들은 내부에 있는 레스토랑에서 간단히 식사를 드실 수 있습니다. 또한 매일 아침 아침 식사가 제공됩니다.','16:00','11:00','on','on','on','on','on',null,'on',null,'on','on','제주특별자치도 서귀포시 성산읍 오조로 140',null,null,null,null,null,'33.46603,126.9132','성산읍 오조로 140','seoguipoEast','승인완료','카카오뱅크',5021820418357,4,4,123500,to_date('19/12/31','RR/MM/DD'));
Insert into PROJECT.HOUSE (HOUSECODE,MEMBERCODE,HOUSENAME,EXPLAIN,BATH,ETC,CHECKINTIME,CHECKOUTTIME,NECESSARY,WIFI,WASHER,HOTWATER,AIRCON,TV,MART,PARKING,KITCHEN,SAFETY,ADDRESS,SIDO,SIGUNGU,ROADNAME,BNAME,JIBUNADDRESS,LATLNG,DETAILADDRESS,LOCAL,APPROVALSTATUS,BANK,ACCOUNT,PEOPLE,BED,PRICE,HOUSEREGDATE) values (256,45,'스테이 오조','숙소에는 두 개의 건물이 있습니다. 하나는 제가 반려묘 히끄와 함께 살고 있는 집이고, 나머지 하나는 게스트가 편하게 묵을 수 있는 스테이 오조 입니다. 이 두 공간은 떨어져 있어서 편하고 독립적이게 사용할 수 있습니다. 차로 5분 거리에 스타벅스, 파리바게뜨 등 편의시설이 있고, 성산일출봉, 우도, 섭지코지가 가깝습니다.',1,'체크아웃시간은 꼭 지켜주셔야합니다.','17:00','10:00','on','on','on','on','on','on','on','on','on','on','제주특별자치도 서귀포시 성산읍 오조로 75-6',null,null,null,null,null,'33.46063,126.9149','오조리 149','seoguipoEast','승인완료','카카오뱅크',5021820418357,2,1,70000,to_date('19/12/31','RR/MM/DD'));
