Insert into PROJECT.HOUSE (HOUSECODE,MEMBERCODE,HOUSENAME,EXPLAIN,BATH,ETC,CHECKINTIME,CHECKOUTTIME,NECESSARY,WIFI,WASHER,HOTWATER,AIRCON,TV,MART,PARKING,KITCHEN,SAFETY,ADDRESS,SIDO,SIGUNGU,ROADNAME,BNAME,JIBUNADDRESS,LATLNG,DETAILADDRESS,LOCAL,APPROVALSTATUS,BANK,ACCOUNT,PEOPLE,BED,PRICE,HOUSEREGDATE) values (385,87,'섬타임즈 제주','섬타임즈 제주에 놀러오세요. 다양한 제주도의 관광지들과 가깝습니다.',2,'섬타임즈 제주에 놀러오세요','13:00','10:30','on','on',null,null,'on','on','on',null,null,null,'제주특별자치도 서귀포시 가가로 14','제주특별자치도','서귀포시','가가로','상예동','제주특별자치도 서귀포시 상예동 4623-8','33.270006544386455,126.3754225460166','섬타임즈제주','seoguipo','심사대기','KEB하나',110349082188,10,2,50000,to_date('20/01/06','RR/MM/DD'));
Insert into PROJECT.HOUSE (HOUSECODE,MEMBERCODE,HOUSENAME,EXPLAIN,BATH,ETC,CHECKINTIME,CHECKOUTTIME,NECESSARY,WIFI,WASHER,HOTWATER,AIRCON,TV,MART,PARKING,KITCHEN,SAFETY,ADDRESS,SIDO,SIGUNGU,ROADNAME,BNAME,JIBUNADDRESS,LATLNG,DETAILADDRESS,LOCAL,APPROVALSTATUS,BANK,ACCOUNT,PEOPLE,BED,PRICE,HOUSEREGDATE) values (388,171,'답다니언덕집','숙소소개<br/><br/>	납읍리라는 작은 중산간 마을이며, 관광지가 아닌 <br/>	예전 그대로의 모습을 잘 간직 하고있어 <br/>	제주도의 마을 분위기를 온전히 즐기실 수 있습니다.<br/><br/>	차를 이용하시면 바다가 5-10분거리 이내에 있어 <br/>	다양한 제주도의 모습들을 쉽게 접할 수 있습니다.<br/><br/>	숙소<br/>	30년된 제주도 민가를 리모델링한 공간입니다.',1,'기타 사항<br/>	<br/>	숙박인원은 영유아 포함 최대 4인입니다.<br/>	<br/>	추가 규칙<br/>	· 다음 손님을 위하여 실내에서는 고기, 생선, 튀김류의 냄새가 심한 요리를 금하고 있습니다.<br/>	또한 실내에서의 금연을 부탁드리며, 외부에서의 흡연 후 꽁초는 인근 과수원으로 버리지 마시기 바랍니다.<br/><br/>	· 실내에서는 촛불 등의 화재위험이 있는 물건들의 사용을 자제 부탁드리겠습니다.<br/><br/>	· 많은 이가 사용하는 곳이기에 반려동물의 출입은 금지하고 있습니다.<br/><br/>	· 비치된 기물을 부득이하게 훼손되었을 시 변상의 책임을 지시기 때문에 소중하게 다뤄주시기 바랍니다.<br/><br/>	· 답다니언덕집은 4인 기준(영,유아포함)으로 계획된 공간입니다. 꼭 정원기준을 지켜주시길 부탁드리겠습니다.<br/><br/>	· 침구는 퀸사이즈 침대가 2개 있습니다. 추가 침구는 제공이 불가합니다.','15:00','11:00','on','on',null,'on',null,null,null,'on',null,null,'제주특별자치도 제주시 애월읍 납읍로2길 10','제주특별자치도','제주시','납읍로2길','납읍리','제주특별자치도 제주시 애월읍 납읍리 1558-1','33.43787407779483,126.33042480390782','답다니언덕집','jejuWest','승인완료','신한',110578974538,4,2,50000,to_date('20/01/06','RR/MM/DD'));
